import React, {Component} from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link,
    useParams
  } from "react-router-dom";

const Tags = (props) => {

    const Child = () => {

        let {id} = useParams();
        props.changeParam(id)
        return (id);
    }

    return (
        <Router>
            <Link className="clover-light" to={props.tagName}>{props.tagName}</Link>
            {console.log(props.changeParam(props.tagName))}
        <Switch>
        <Route path="/:id" onClick={Child} />
        </Switch>
        </Router>
    );
}

export default Tags;
